import { initialState } from './initialState';

function currentProgramReducer(state = initialState.currentProgram, action) {
  switch (action.type) {
    case 'SET_CURRENT_PROGRAM':
      return action.payload;

    default:
      return state;
  }
}

export { currentProgramReducer };
